// src/administrador/componentes/SidebarAdmin.js
import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import {
    FaHome, FaTachometerAlt, FaUsers, FaParking, FaFileAlt, FaTools, FaBell, FaEnvelope, FaCalendarAlt, FaShieldAlt, FaFileContract, FaCog, FaUser, FaBuilding, FaUserTie
} from 'react-icons/fa';
import './SidebarAdmin.css';
import logo from '../../assets/logo.png';

const SidebarAdmin = ({ isCollapsed, toggleSidebar }) => {
    const location = useLocation();

    const navItems = [
        { icon: <FaHome />, label: 'Inicio', path: '/inicio' },
        { icon: <FaTachometerAlt />, label: 'Dashboard', path: '/dashboard' },
        { icon: <FaUsers />, label: 'Residentes', path: '/residentes' },
        { icon: <FaParking />, label: 'Cocheras', path: '/cocheras' },
        { icon: <FaFileAlt />, label: 'Reportes', path: '/reportes' },
        { icon: <FaTools />, label: 'Mantenimiento', path: '/mantenimiento' },
        { icon: <FaBell />, label: 'Notificaciones', path: '/notificaciones' },
        { icon: <FaEnvelope />, label: 'Correspondencia', path: '/correspondencia' },
        { icon: <FaCalendarAlt />, label: 'Eventos', path: '/eventos' },
        { icon: <FaShieldAlt />, label: 'Accesos', path: '/accesos' },
        { icon: <FaFileContract />, label: 'Documentos', path: '/documentos' },
        { icon: <FaBuilding />, label: 'Áreas comunes', path: '/areas-comunes' },
        { icon: <FaUserTie />, label: 'Empleados', path: '/empleados' },
    ];

    return (
        <div className={`sidebar bg-primary d-flex flex-column text-white ${isCollapsed ? 'collapsed' : ''}`}>
            <div className="sidebar-header d-flex align-items-center justify-content-between p-3 border-bottom">
                <div className="d-flex align-items-center">
                    <img src={logo} alt="Logo" className="sidebar-logo rounded-circle me-2" />
                    {!isCollapsed && <h5 className="m-0">Parques de la Huaca</h5>}
                </div>
                <button className="btn btn-light toggle-btn" onClick={toggleSidebar}>
                    {isCollapsed ? <span className="material-icons">menu</span> : <span className="material-icons">menu_open</span>}
                </button>
            </div>
            <div className="sidebar-main-content flex-grow-1">
                <ul className="nav flex-column mt-2">
                    {navItems.map((item, index) => (
                        <li key={index} className={`nav-item ${location.pathname === item.path ? 'active' : ''}`}>
                            <Link to={item.path} className="nav-link text-white d-flex align-items-center px-3 py-2">
                                <span className="me-2">{item.icon}</span>
                                {!isCollapsed && <span>{item.label}</span>}
                            </Link>
                        </li>
                    ))}
                </ul>
            </div>
            <div className="sidebar-footer d-flex flex-column align-items-center p-3">
                <Link to="/configuracion" className="nav-link text-white">
                    <FaCog className="me-2" /> {!isCollapsed && 'Configuración'}
                </Link>
                <Link to="/usuario" className="nav-link text-white mt-2">
                    <FaUser className="me-2" /> {!isCollapsed && 'Usuario'}
                </Link>
            </div>
        </div>
    );
};

export default SidebarAdmin;
